import React from "react";
import { NavigationContainer } from '@react-navigation/native';
import { createNativeStackNavigator } from '@react-navigation/native-stack';
import SectionPercents from "../View/SectionPercents";
import SectionCalculator from "../View/SectionCalculator";
import SectionChatsRoom from "../View/SectionChatsRoom"
import Chats from "../Components/ChatsRoom/Screen/Chats";


const Stack = createNativeStackNavigator();

const MainStack = () => {
    return (
        <NavigationContainer>
            <Stack.Navigator>

                <Stack.Screen
                    name="SectionPercents"
                    component={SectionPercents}
                    options={{ title: '%' }}
                />


                <Stack.Screen
                    name="SectionCalculator"
                    component={SectionCalculator}
                    options={{ title: 'Calculator' }}
                />

                <Stack.Screen
                    name="SectionChatsRoom"
                    component={Chats}
                    options={{ title: 'Chats Room' }}
                />


            </Stack.Navigator>
        </NavigationContainer>
    )
}
export default MainStack;
